if mibBuilder.loadTexts: ciscoGtcapMIB.setDescription('The MIB for Transaction Capabilities(TCAP) messages transported over Signalling System No. 7 (SS7) Network via Cisco IP Transfer Point. This MIB provides information specified in ITU Q752 Monitoring and Measurements for Signalling System No. 7(SS7) Network. The Cisco IP Transfer Point (ITP) is a hardware and software solution that transports SS7 traffic using IP. Each ITP node provides function similar to SS7 Signalling point. The relevant ITU documents describing this technology is the ITU Q series, ITU Q.771: Functional Description of Transaction Capabilities to ITU Q.775: Guidelines for Using Transaction Capabilities. This MIB consists of the following tables: Instance Table TCAP Utilization table TCAP Protocol Transaction Errors Received Table TCAP Protocol Transaction Errors Sent Table TCAP Protocol Component Errors Table TCAP User Errors Received Table TCAP User Errors Sent Table Abbreviations: ANSI - American National Standards Institute CLLI - Common-Language Location Identification GP - General Problem IP - Invoke Problem ITU - International Telecommunication Union MAP - SS7 Mobile Application Part. This layer provides mobility procedures to SS7 network applications. MAP is generically used to refer to both GSM-MAP, and the IS-41-D MAP Protocol. RRP - Return Result Problem REP - Return Error Problem TCAP - Transaction Capabilities Application Part. The application layer of the SS7 signalling protocol. TC - Transaction Capabiliities TID - Transaction Identifier TP - Transaction Problem.')
